# Functions
def load_picle(name):
    pickleFileName = FOLDER_PATH + name
    
    pickleFile = open(pickleFileName, 'rb')

    pickle_data = pickle.load(pickleFile)

    pickleFile.close()
    
    #Calculate the average of the amplitudes at each frequency (rows)
    average_pxx = []
    for pxx_item in pickle_data:
        average_pxx.append(sum(pxx_item)/len(pxx_item))
    
    return average_pxx


def read_csv(filename):
    """Read the file with test data"""
    file_path = FOLDER_PATH + filename
    
    #Open up the csv file in to an object
    csv_file_object = csv.reader(open(file_path, 'r'))
    
    #Run through each row in the csv file adding each row to the data variable
    data = []
    for counter,row in enumerate(csv_file_object):
        data.append([float(number) for number in row[1::]]) #From str to float
        
        #Limit the data to test
        """
        if counter == 10:
            break
        """
    
    return data

def euclidean_distance(data1,data2):
    d=0.0
    for i in range(len(data1)):
        d += (data2[i]-data1[i])**2

    return 1/(1+math.sqrt(d)) #To get a value between 0 and 1 where 1 is similar

def cosine_distance(v1,v2):
    
    dot_product = sum([v1[counter] * v2[counter] for counter in range(len(v1))])
    l2_norm_vec1 = math.sqrt(sum([math.pow(item,2) for item in v1]))
    l2_norm_vec2 = math.sqrt(sum([math.pow(item,2) for item in v2]))
    
    #Avoid division by 0
    den = l2_norm_vec1*l2_norm_vec2
    if den == 0:
        return 0
    else:
        cosine_sim = dot_product/den
    
        return cosine_sim #To get a value between 0 and 1 where 1 is similar

def get_distance(data1,data2):
    """Get the distance from some distance method"""
    
    #distance = euclidean_distance(data1,data2)
    distance = cosine_distance(data1,data2)
    
    return distance
    

